import { Route, Link, Routes } from "react-router-dom";
import AllQuotes from "./pages/AllQuotes";
import QuoteDetails from "./pages/QuoteDetail";
import NewQuote from "./pages/NewQuote";

function App() {
  return (
    <Routes>
      <div>
        <Route to="/quotes">
          <AllQuotes />
        </Route>
        <Route to="/quotes/:quoteId">
          <QuoteDetails />
        </Route>
        <Route to="/new-quote">
          <NewQuote />
        </Route>
      </div>
    </Routes>
  );
}

export default App;
